import React from 'react';
import bg_Desktop_Light from './components/bg-desktop-light.jpg'
import bg_Desktop_Dark from './components/bg-desktop-dark.jpg'
import bg_Mobile_Light from './components/bg-mobile-light.jpg'
import bg_Mobile_Dark from './components/bg-mobile-dark.jpg'

function App() {
  return (
    <div className='main'>
      <img src={bg_Desktop_Light} alt='' />
    </div>
  );
}

export default App;
